import React from 'react'

function TodoK() {
  return (
    <div>
      <span style={{ textDecoration: todo.complete ? 'line-through' : 'none' }}>
        {todo.task}
      </span>
      <button onClick={() => toggleTask(todo.id)}>Toggle</button>
      <button onClick={() => deleteTask(todo.id)}>Delete</button>
    </div>
  )
}

export default Todo
